module Lexer
# 1 "Lexer.fsl"
 
    
open System
open FSharp.Text.Lexing
open Parser

let lexeme lexbuf = LexBuffer<_>.LexemeString lexbuf

let operators =

    [

        "+", ADDITIVE_OPERATOR;
        "-", ADDITIVE_OPERATOR;
        "*", MULTIPLICATIVE_OPERATOR;
        "/", MULTIPLICATIVE_OPERATOR;
