    ] |> Map.ofList

let keywords =

    [
                 
        "and", AND;
        "each", EACH;
        "else", ELSE;
        "error", ERROR;
        "as", AS;
        "false", FALSE;
        "if", IF;
        "in", IN;
        "is", IS;
        "let", LET;
        "meta", META;
        "not", NOT;
        "null", NULL;
        "or", OR;
        "otherwise", OTHERWISE;
        "section", SECTION;
        "shared", SHARED;
        "then", THEN;
        "true", TRUE;
        "try", TRY;
        "type", TYPE;
        "#binary", SHARP_BINARY;
        "#date", SHARP_DATE;
        "#datetime", SHARP_DATETIME;
        "#datetimezone", SHARP_DATETIMEZONE;
        "#duration", SHARP_DURATION;
        "#infinity", SHARP_INFINITY;
        "#nan", SHARP_NAN;
        "#sections", SHARP_SECTION;
        "#shared", SHARP_SHARED;
        "#table", SHARP_TABLE;
        "#time", SHARP_TIME;

    ] |> Map.ofList


let removePrime (s: string) = s.Substring(0, s.Length - 1) 

let trimWhiteAndNewLine (s: string) = s.Trim([| ' '; '\t'; '\n'; '\r' |])
let trimWhite (s: string) = s.Trim([| ' '; '\t' |])


